import React from "react";
import YoutubeEmbed from "../../../../Utils/YoutubeEmbed";
import startupscreen from "./startupscreen.png";


const CodeTDetail = () => (
  <>
    {/* <img src={startupscreen} alt="Code-T In-Game Screenshot" height="400px" style={{padding: "40px"}} /> */}
    <p>
      Code-T is a multiplayer shooter game that is developed by Tian Yang and
      me. The game supports game modes including Team Death Match, Objectives
      Domination, and PVE. This project is developed with Unreal Engine 4,
      with integration of Unreal Gameplay Ability System and Unreal slua plugin.<br /><br />
    </p>
    <YoutubeEmbed embedId="rokGy0huYEA" />
  </>
);

export default CodeTDetail;
